import Navbar from './Components/Navbar';
import Main from './Components/Main';
import Footer from './Components/Footer';
import {BrowserRouther as Router, Switch, Route, Link} from 'react-router-dom';

function App() {
  return (
    <div className = "container">
      <Navbar />
      <Main />
      <Footer />
    </div>
  );
}

function Input(){
  return(
    <div>
      <h1>Input</h1>
    </div>
  );
}

function Results(){
  return(
    <div>
      <h1>Results</h1>
    </div>
  );
}

function Explanation(){
  return(
    <div>
      <h1>Explanation</h1>
    </div>
  );
}

export default App;
